INSERT INTO `blog` (`id`, `title`, `like_count`, `subtitle`, `description`, `img`, `date_time`) VALUES
(1,	'How to take care of pets ',	2,	'Sub header .com',	'Having a pet sounds interesting and fun. But, adopting a pet and taking care of them is a big responsibility. Here are some of the tips which will help you <b>to take good</b> care of your pet and keep them happy, active and healthy:Feed your pet a good and high-quality foods\r\n\r\nTake them for a walk every day for at least half an hour\r\n\r\nProvide them with the needed vaccination on time\r\n\r\nKeep a clean and hygienic environment for them\r\n\r\nVisit Vet on a weekly/monthly basis\r\n\r\nEngage and do not leave them alone for a long time\r\n\r\nProvide them with a good and comfortable shelter\r\n\r\nKeep them away from dust and allergies\r\n\r\nLove them unconditionally, treat them like your family, talk to them',	'dog_images.jpg',	'2020-01-15 12:01:20'),
(2,	'Dog are something ',	2,	'Yest to  dog please',	'Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog <h1>Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog</h1> Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog Dog  ',	'dog_people_slideshow_alt.jpg',	'2020-01-24 12:01:20'),
(3,	'blog 3',	0,	'Pets are best',	'Here are some of the tips which will help you to take good care of your pet and keep them happy, active and healthy:',	'dog_images.jpg',	'2021-04-30 10:56:34'),
(4,	'blog 4',	0,	'cats are best',	'fsfsfsd',	'dog_images.jpg',	'2021-04-30 10:58:10');
